class CmlrAddressDigits(TextualConvention, OctetString):
    reference = 'GSM 04.08 Table 10.5.118,ANSI T1.114.5 Figure 8 and ETSI TS 123 038 V5.0.0 (2002-03)'
    description = "The configured digits of A-address or B-address specified in the format indicated by CmlrAddressType. All values are entered in binary and represent digits All values are encoded as hexidecimal values and represent the following characters by address type are as follows. CmlrAddressType: 'bch' GSM: Encoding Character 0000-1001 0-9 1010 * 1011 # 1100 a 1101 b 1110 c 1111 filler ANSI-41 0000-1001 0-9 1010 Spare 1011 Code 11 1100 Code 12 1101 * 1110 # 1111 ST (or filler) CmlrAddressType: 'gmsDa' |0 0 0 0 1 1 1 1 b7 b b b b |0 0 1 1 0 0 1 1 b6 4 3 2 1 |0 1 0 1 0 1 0 1 b5 ----------------------------------- 0 0 0 0 |@ . SP 0 P p 0 0 0 1 | _ ! 1 A Q a q 0 0 1 0 |$ F DQ 2 B R b r 0 0 1 1 | G # 3 C S c s 0 1 0 0 | . 4 D T d t 0 1 0 1 | . % 5 E U e u 0 1 1 0 | . & 6 F V f v 0 1 1 1 | . ' 7 G W g w 1 0 0 0 | S ( 8 H X h x 1 0 0 1 | T ) 9 I Y i y 1 0 1 0 |LF . * : J Z j z 1 0 1 1 | 1) + ; K k 1 1 0 0 | , < L l 1 1 0 1 |CR - = M m 1 1 1 0 | . > N n . 1 1 1 1 | / ? O o 'SP' - Space 'LF' - Line Feed 'DQ' - Double quote '.' = Special characters outside standard ASCII See 6.2.1 GSM 7 bit Default Alphabet Table. The string will consists of N Octets were the first n-1 octets represent the hexadecimal address. The last Octet specifies the number of bits used to match the calling address. For example, when CmlrAddressType is Binary Coded Hexadecimal the following entries illustrate why the trailing number of match bits is required. '081000000000000000000C' match '081' '0810000000000000000010' match '0810' "
